import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const endpoint = "http://localhost/api/vehiculo";
const AddVehiculo = () => {
  const [cantidad_ruedas, setCantidadRueda] = useState("");
  const [numero_chasis, setNumeroChasis] = useState("");
  const [id_tipo_vehiculo, setIdTipoVehiculo] = useState("");
  const navigate = useNavigate();

  const store = async (e) => {
    e.preventDefault();
    await axios.post(endpoint, {
      cantidad_ruedas: cantidad_ruedas,
      numero_chasis: numero_chasis,
      id_tipo_vehiculo: id_tipo_vehiculo,
    });
    navigate("/");
  };
  return (
    <div>
      <h2>Agregar nuevo vehiculo</h2>
      <form onSubmit={store}>
        <div className="mb-3">
          <label className="form-label">Cantidad de Ruedas</label>
          <input
            value={cantidad_ruedas}
            onChange={(e) => setCantidadRueda(e.target.value)}
            type="text"
            className="form-control"
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Numero de Chasis</label>
          <input
            value={numero_chasis}
            onChange={(e) => setNumeroChasis(e.target.value)}
            type="text"
            className="form-control"
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Tipo de vehiculo</label>
          <input
            value={id_tipo_vehiculo}
            onChange={(e) => setIdTipoVehiculo(e.target.value)}
            type="text"
            className="form-control"
          />
        </div>

        <button type="submit" className="btn btn-success">
          Guardar
        </button>
      </form>
    </div>
  );
};

export default AddVehiculo;
